import React, {useEffect, useState} from 'react';
import Style from "./Questions.module.css";
import { Button } from '@mui/material';

const QuestionsModal = (_question : any, _answer : any) => {
    let counter = 1;

    const handleSubmit = () => {
        counter += 1;
    }

    const questions = [
    {
        question: "What is the tallest mountain?",
        answer1: "Test 1",
        answer2: "Test 2",
        answer3: "Test 3",
        answer4: "Test 4",

    },

  ];

    return (
        <div className={Style.modal}>
            <div className={Style.modal_inner}>
                <h3 className={Style.modal__inner__title}>Question {counter}</h3>

                {questions.map((el, i) => (
                    <>
                        <h4 key={i + 1} className={Style.modal__inner__subtitle}>
                        {el.question}
                        </h4>
                        <div className={Style.modal__inner__btn_container}>
                            <Button
                            className={Style.modal__inner__button}
                            variant="outlined"
                            color="secondary"
                            >
                                {el.answer1}
                            </Button>
                        </div>
                    </>
                ))}
            </div>
        </div>
    )
}

export default QuestionsModal
